import React, { useState, useEffect, useRef } from "react";
import "tailwindcss/tailwind.css";
import github from "./icons/github.png";
import behance from "./icons/behance.png";
import gmail from "./icons/gmail.png";
import linkedin from "./icons/linkedin.png";
import medium from "./icons/medium.png";

function Terminal() {
  const [command, setCommand] = useState("");
  const [output, setOutput] = useState([]);
  const [welcomeMessage, setWelcomeMessage] = useState(
    "Welcome to my portfolio! To start exploring this Terminal type <i>help</i> then press enter. Note that the Tab Key helps you complete the commands."
  );

  const terminalRef = useRef(null);

  useEffect(() => {
    terminalRef.current.scrollTop = terminalRef.current.scrollHeight;
  }, [output]);

  function handleCommand(e) {
    e.preventDefault();
    let newOutput = [...output, { command: command, output: "" }];
    switch (command.toLowerCase()) {
      case "about":
        newOutput[newOutput.length - 1].output = `My name is Fatima STAILI, I am a cybersecurity student who has had a long-standing passion for technology and security and a slight web development background, I am currently working on networking certifications. I am a bachelor student in cyber security and a member of the development department of the GDG club, based in Orleans.`;
        break;
      case "work":
        newOutput[newOutput.length - 1].output = (
          <>
            <table className="table-auto">
              <thead>
                <tr>
                  <th className="px-4 py-2">Date</th>
                  <th className="px-4 py-2">Entreprise</th>
                  <th className="px-4 py-2">Role</th>
                  <th className="px-4 py-2">Description</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td className="border px-4 py-2"></td>
                  <td className="border px-4 py-2"></td>
                  <td className="border px-4 py-2">Digital Mediator</td>
                  <td className="border px-4 py-2"></td>
                </tr>
                <tr>
                  <td className="border px-4 py-2"></td>
                  <td className="border px-4 py-2"></td>
                  <td className="border px-4 py-2">Assistant Chief Information Security Officer (CISO)</td>
                  <td className="border px-4 py-2"></td>
                </tr>
                <tr>
                  <td className="border px-4 py-2"></td>
                  <td className="border px-4 py-2"></td>
                  <td className="border px-4 py-2">Assistant System and Network Administrator</td>
                  <td className="border px-4 py-2"></td>
                </tr>
                <tr>
                  <td className="border px-4 py-2"></td>
                  <td className="border px-4 py-2"></td>
                  <td className="border px-4 py-2">Full Stack Web Developer</td>
                  <td className="border px-4 py-2"></td>
                </tr>
              </tbody>
            </table>
          </>
        );
        break;
      case "projects":
        newOutput[newOutput.length - 1].output = `Project list`;
        break;
      case "skills":
        newOutput[newOutput.length - 1].output = `Skills list`;
        break;
      case "achievements":
        newOutput[newOutput.length - 1].output = `Achievements list`;
        break;
      case "interests":
        newOutput[newOutput.length - 1].output = `Interests list`;
        break;
      case "education":
        newOutput[newOutput.length - 1].output = `Education list`;
        break;
      case "contact":
        newOutput[newOutput.length - 1].output = (
          <>
            <p>staili.fatima@gmail.com</p>
            <p>
              <a href="https://github.com/Staili" target="_blank">
                <img src={github} alt="github" />
              </a>
              <a href="https://www.linkedin.com/in/fatima-staili/" target="_blank">
                <img src={linkedin} alt="linkedin" />
              </a>
              <a href="https://www.behance.net/staili" target="_blank">
                <img src={behance} alt="behance" />
              </a>
              <a href="mailto:staili.fatima@gmail.com" target="_blank">
                <img src={gmail} alt="gmail" />
              </a>
              <a href="https://medium.com/@staili.fatima" target="_blank">
                <img src={medium} alt="medium" />
              </a>
            </p>
          </>
        );
        break;
      case "help":
        newOutput[newOutput.length - 1].output = `List of commands: about, work, projects, skills, achievements, interests, education, contact`;
        break;
      default:
        newOutput[newOutput.length - 1].output = `Command not found`;
        break;
    }
    setOutput(newOutput);
    setCommand("");
  }

  return (
    <div
      className="bg-black min-h-screen flex flex-col justify-center items-center"
      style={{ fontFamily: "Inconsolata", fontSize: "1.2em" }}
    >
      <div className="bg-black p-6 max-w-2xl mx-auto text-white overflow-y-scroll h-96">
        <div
          dangerouslySetInnerHTML={{ __html: welcomeMessage }}
          style={{ color: "white" }}
        ></div>
        {output.map((out, i) => (
          <div key={i}>
            <div className="flex">
              <div className="text-blue-500">visitor@terminal.staili : ~$ </div>
              <div className="text-green-500">{out.command}</div>
            </div>
            <div style={{ whiteSpace: "pre-wrap", wordWrap: "break-word" }}>
              {typeof out.output === "string" ? (
                <div
                  dangerouslySetInnerHTML={{ __html: out.output }}
                  style={{ color: "white" }}
                ></div>
              ) : (
                out.output
              )}
            </div>
          </div>
        ))}
        <form onSubmit={handleCommand} className="flex mt-4">
          <div className="text-blue-500">visitor@terminal.staili : ~$ </div>
          <input
            type="text"
            value={command}
            onChange={(e) => setCommand(e.target.value)}
            className="bg-black text-white ml-2 flex-grow outline-none"
          />
        </form>
      </div>
    </div>
  );
}

export default Terminal;
